import './App.css';
import CryptoCard from './components/CrytoCard'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Col,Row,Container } from 'react-bootstrap';


function App() {
  return (
    <div className="App">
      <Container>
      <Row>
      <Col lg={4}>
      <CryptoCard />
      </Col>
      </Row>
      </Container>
    </div>
  );
}

export default App;
